rrent commander (victim) to step down.','halflife','natural'),(23,'structure_destroyed',0,0,0,0,'A player destroyed a structure','halflife','natural'),(36,'kill_assist',0,0,0,0,'When a player assists in another kill','halflife','tf2'),(35,'commander_win',0,0,0,0,'When the marines win, the commander can be given some bonus points.','halflife','natural'),(27,'round_win',0,5,0,-5,'TEAM event that fires when a round ends and a team won','halflife','dod|natural'),(28,'killed_a_hostage',-3,0,0,0,'When a player kills a hostage','halflife','cstrike'),(29,'escaped_as_vip',10,0,0,0,'When a player escapes an \'es\' map as the VIP (use \'vip_escaped\' for team bonuses)','halflife','cstrike'),(30,'vip_escaped',0,5,0,-5,'TEAM event that fires when the VIP escapes the map (use escaped_as_vip for enactor bonus)','halflife','cstrike'),(31,'assassinated_the_vip',10,0,-5,0,'When a player kills the VIP (use \'vip_assassinated\' for team bonuses)','halflife','cstrike'),(32,'vip_assassinated',0,10,0,-10,'TEAM event that fires when the VIP was killed (use \'assassinated_the_vip\' for enactor bonus)','halflife','cstrike'),(33,'vip_not_escaped',0,5,0,-5,'TEAM event that fires when the VIP does not escape and terrorists win','halflife','cstrike'),(34,'ffkill',-1,0,0,0,'when a player kills a team mate','',''),(37,'flag_defended',5,0,0,0,'When a player defends a flag','halflife','tf2'),(38,'flag_captured',5,0,0,0,'When a player captures a flag','halflife','tf2'),(39,'chargedeployed',0,0,0,0,'When a player (medic) deploys their uber charge thingy','halflife','tf2'),(40,'captureblocked',0,0,0,0,'When a player blocks another from capturing a point','halflife','tf2'),(41,'pointcaptured',0,5,0,-5,'TEAM event that fires when a point is captured','halflife','tf2');
